import Link from 'next/link'
import styles from '../styles/btn.module.css'

export default function Btn({ primary, children, className, onClick, link }) {
  return (
    <>
      <Link href={link}>
        <a>
          <button
            className={`${styles.btn} ${primary && className && styles.primary + className || primary && styles.primary || className}`}
            onClick={onClick}
          >
            {children}
          </button>
        </a>
      </Link>
    </>
  )
}
